#include <mpi.h>

// Number of vertices in the graph
#define V 100

// A utility function to find the vertex with minimum
// distance value, from the set of vertices not yet included
// in shortest path tree
int minDistance(int dist[], bool sptSet[]){
    // Initialize min value
    int min = INT_MAX, min_index;
    for (int v = 0; v < V; v++)
        if (sptSet[v] == false && dist[v] <= min)
            min = dist[v], min_index = v;
 
    return min_index;
}

//Utility function to print constructed distance array
int printSolution(int dist[], int n, int src){
    printf("Vertex Distance from %d\n", src);
    for (int i = 0; i < V; i++)
        printf("%d \t\t %d\n", i, dist[i]);
}

void dijkstra(int graph[V][V], int nThreads){
    double start,elapsed;
    int count,v;
    int src = 0;
       
    int* dist; // The output array.  dist[i] will hold the shortest
    // distance from src to i
    dist = malloc(V*sizeof(int));
 
    bool* sptSet; // sptSet[i] will be true if vertex i is included in shortest
    // path tree or shortest distance from src to i is finalized
    sptSet = malloc(V*sizeof(int));
    // Initialize all distances as INFINITE and stpSet[] as false
    for (int i = 0; i < V; i++)
        dist[i] = INT_MAX, sptSet[i] = false;
 
    // Distance of source vertex from itself is always 0
    dist[src] = 0;

    start = MPI_Wtime();

    for (count = 0; count < V - 1; count++) {
        // Pick the minimum distance vertex from the set of
        // vertices not yet processed. u is always equal to
        // src in the first iteration.
        int u = minDistance(dist, sptSet);

        // Mark the picked vertex as processed
        MPI_Win_lock(MPI_LOCK_EXCLUSIVE, rank, 0, win);
        sptSet[u] = true;
	  MPI_Win_unlock(rank, win);

        // Update dist value of the adjacent vertices of the
        // picked vertex.
        MPI_Comm_split(MPI_COMM_WORLD,rank<size,rank,&loop_comm);
        for (v = 0; v < V; v++) {
            // Update dist[v] only if is not in sptSet,
            // there is an edge from u to v, and total
            // weight of path from src to  v through u is
            // smaller than current value of dist[v]
            if (!sptSet[v] && graph[u][v] && dist[u] != INT_MAX
                && dist[u] + graph[u][v] < dist[v]){
                    // Use crit section, safely update dist array
                    MPI_Win_lock(MPI_LOCK_EXCLUSIVE,rank,0,win);
                    dist[v] = dist[u] + graph[u][v];
			    MPI_Win_unlock(rank, win);
                }
        }
    }  
    elapsed = MPI_Wtime() -start;
    // print the constructed distance array
    printf("took %f seconds to execute", elapsed);
    free(sptSet);
}
